import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="bg-neutral-800 min-h-screen w-full">
      <div className="w-full text-white text-[250%] bg-red-300">
        <div>
        "Some profound Quote here"
        </div>
      </div>
      <div className="bg-black h-[500px] w-[70%] my-[13%] mx-auto"></div>
    </div>
  );
}

export default App;
